import React from "react";

function Header () {
    return(
        <div className="navbar bg-primary rounded">
            <img src='https://www.portnet.ma/sites/all/themes/portnet/images/new-logo2_fr.png' alt='logo' width="250"/>
            <h2>Team members</h2>
        </div>
    )
}

export default Header;
